import React from 'react';
import TableWidget from '../widgets/TableWidget'



function Eventtable(props){
    const {title, columns}=props
    return (
        <React.Fragment>            
            <TableWidget 
              rows={rows} 
              defaultSort='name'
              columns={columns}
              tableTitle={title}            
            />
        </React.Fragment>
    );
}

export default Eventtable;
